CREATE DATABASE IF NOT EXISTS academy;
USE academy;

DROP TABLE IF EXISTS academy.students;
DROP TABLE IF EXISTS academy.enrollments;
-- Create the students table
CREATE TABLE IF NOT EXISTS academy.students (
  student_id UUID DEFAULT gen_random_uuid() PRIMARY KEY, -- UUID as primary key
  last_name TEXT NOT NULL,
  first_name TEXT NOT NULL,
  email TEXT NOT NULL, -- Ensure emails are unique
  bio TEXT NULL
);

-- Create the enrollments table
CREATE TABLE IF NOT EXISTS academy.enrollments (
  student_id UUID REFERENCES academy.students (student_id)
    ON DELETE CASCADE,
  program_name TEXT NOT NULL,
  --instructor TEXT NOT NULL,
  courses TEXT[], -- Array of topics
  enrolled_at TIMESTAMPTZ DEFAULT now(),
  PRIMARY KEY (enrolled_at, student_id)
);



